import React from 'react';
import Togglable from './Togglable'

const Blog = ({ blog }) => {

  return (
    <div>
      <p>
      {blog.title} {blog.author}
      <Togglable buttonLabel='view'></Togglable>
      </p>
    </div>
  )
};

export default Blog;
